import React from "react";
import { useState } from "react";
import Box from "@mui/material/Box";
import { Button, TextField, Typography } from "@mui/material";
import { useNavigate } from "react-router-dom";
import Grid from "@mui/material/Grid";

export default function AddUserForm() {
  const navigate = useNavigate();

  const [user, setNewUser] = useState({
    user_firstName: "",
    user_lastName: "",
    user_email: "",
    password: "",
  });

  async function handleSubmit(e) {
    e.preventDefault();
    const db = "http://localhost:3000/users";

    await fetch(db, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(user),
    });
    navigate(`/users`);
  }

  return (
    <main>
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          flexWrap: "wrap",
          justifyContent: "center",
          maxWidth: 300,
          m: 10,
        }}
      >
        <Typography variant="h3"> Add new user</Typography>

        <Box sx={{ "& .MuiTextField-root": { m: 1, width: 300 } }}>
          <form method="POST" action="/users" onSubmit={handleSubmit}>
            <TextField
              defaultValue={""}
              onChange={(e) =>
                setNewUser({ ...user, user_firstName: e.target.value })
              }
              id="outlined-basic"
              fullWidth
              label="First Name"
              variant="outlined"
            />

            <TextField
              onChange={(e) =>
                setNewUser({ ...user, user_lastName: e.target.value })
              }
              id="outlined-basic"
              fullWidth
              label="Last Name"
              variant="outlined"
            />

            <TextField
              onChange={(e) =>
                setNewUser({ ...user, user_email: e.target.value })
              }
              id="outlined-basic"
              fullWidth
              label="Email"
              variant="outlined"
            />

            <TextField
              onChange={(e) =>
                setNewUser({ ...user, password: e.target.value })
              }
              id="outlined-basic"
              fullWidth
              label="Password"
              variant="outlined"
            />
            <br />
            <Box
              sx={{
                display: "flex",
                flexWrap: "wrap",
                justifyContent: "space-evenly",
                maxWidth: 450,
              }}
            >
              <Grid>
                <Button variant="contained" color="primary" type="submit">
                  {" "}
                  Add User
                </Button>
              </Grid>
              <Grid>
                <Button variant="contained" href="/users">
                  {" "}
                  Cancel
                </Button>
              </Grid>
            </Box>
          </form>
        </Box>
      </Box>
    </main>
  );
}
